import './Asked.css';

import { Accordion, Col, Container, Row } from "react-bootstrap"

function Asked(){

    const ArraysOfAsked = [{
        id: 1,
        header: "What kind of websites I can build with Zeus UI?",
        body: "This FAQ section is now in the expanded state, so you see how it looks. Rhoncus sed facilisi sed amet. Tristique commodo sodales."
    },
    {
        id: 2,
        header: "What makes Zeus UI literally the best Web UI kit in the Internet?",
        body: "This FAQ section is now in the expanded state, so you see how it looks. Rhoncus sed facilisi sed amet. Tristique commodo sodales."
    },
    {
        id: 3,
        header: "How much does Zeus UI cost?",
        body: "This FAQ section is now in the expanded state, so you see how it looks. Rhoncus sed facilisi sed amet. Tristique commodo sodales."
    },
    {
        id: 4,
        header: "How long will you support Zeus UI?",
        body: "This FAQ section is now in the expanded state, so you see how it looks. Rhoncus sed facilisi sed amet. Tristique commodo sodales."
    }]
    const ArraysOfAskedOnMap = ArraysOfAsked.map((ArrayOfAsked) =>
        <Accordion.Item>
            <Accordion.Header>{ArrayOfAsked.header}</Accordion.Header>
            <Accordion.Body>{ArrayOfAsked.body}</Accordion.Body>
        </Accordion.Item>
    )

    return(
        <Container className = "asked">
            <Row>
                <Col md = "4">
                    <h1>Frequently Asked Questions</h1>
                    <p>Risus commodo id odio turpis pharetra elementum. Pulvinar porta porta feugiat scelerisque in elit. Morbi rhoncus, tellus, eros consequat magna semper orci a tincidunt. </p>
                </Col>
                
                <Col md = "4">
                    <Accordion>
                        {ArraysOfAskedOnMap}
                    </Accordion>
                </Col>
                
                <Col md = "4">
                    <Accordion>
                        {ArraysOfAskedOnMap}
                    </Accordion>
                </Col>
            </Row>
        </Container>
    )
}

export default Asked
